model Client {
  id     String @id
  name   String
  email  String
  phone  String
  userId String
}

model Sale {
  id        String        @id
  saleType  Sale_saleType
  amount    Float
  timestamp DateTime
  userId    String
}

model Task {
  id       String        @id
  taskType Task_taskType
  status   Task_status
  details  Json
  userId   String
}

model User {
  id       String    @id
  username String
  password String
  role     User_role
}

enum Task_taskType {
  MEETING
  CALL
  EMAIL
  FOLLOW_UP
}

enum Sale_saleType {
  NEW_POLICY
  RENEWAL
  UPGRADE
}

enum Task_status {
  PENDING
  COMPLETED
  CANCELLED
}

enum User_role {
  ADMIN
  AGENT
  SALES_REP
}
